enne pour chaque note possible (A, B, C, P, Z et Not Yet Graded). &lt;/p&gt;\n&lt;p&gt; La taille du point est choisie par l'utilisateur selon la cat\u00e9gorie de la note. \nLa taille pour la moyenne globale a \u00e9t\u00e9 divis\u00e9e par 3 pour que l'on puisse voir tous les points\net qu'il n'y ait pas un point qui cache tous les autres. &lt;/p&gt;\n&lt;/br&gt;\n\n&lt;p&gt; Les deux notes les plus courantes sont celles nomm\u00e9es A ou B. &lt;/p&gt;\n&lt;/br&gt;\n\n&lt;p&gt; Retour \u00e0 la page d'accueil : &lt;a href=\"../sommaire.html\"&gt;ici&lt;/a&gt;&lt;/p&gt;\n\n"},"id":"6555","type":"Div"},{"attributes":{"axis":{"id":"6511"},"coordinates":null,"group":null,"ticker":null},"id":"6518","type":"Grid"},{"attributes":{"coordinates":null,"formatter":{"id":"6522"},"group":null,"major_label_policy":{"id":"6562"},"ticker":{"id":"6520"}},"id":"6519","type":"MercatorAxis"},{"attributes":{"dimension":"lat"},"id":"6522","type":"MercatorTickFormatter"},{"attributes":{"children":[{"id":"6500"},{"id":"6556"}]},"id":"6557","type":"Row"},{"attributes":{"axis":{"id":"6519"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"6526","type":"Grid"},{"attributes":{"args":{"other":{"id":"6540"}},"code":"other.fill_alpha = this.value"},"id":"6554","type":"CustomJS"},{"attributes":{"children":[{"id":"6555"},{"id":"6557"}]},"id":"6558","type":"Column"},{"attributes":{"active_scroll":{"id":"6528"},"tools":[{"id":"6527"},{"id":"6528"},{"id":"6529"},{"id":"6530"},{"id":"6547"}]},"id":"6531","type":"Toolbar"},{"attributes":{"coordinates":null,"data_source":{"id":"6499"},"glyph":{"id":"6540"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"6542"},"nonselection_glyph":{"id":"6541"},"view":{"id":"6544"}},"id":"6543","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"group":null,"tile_source":{"id":"6536"}},"id":"6537","type":"TileRenderer"},{"attributes":{"args":{"other":{"id":"6540"}},"code":"other.line_color = this.color"},"id":"6552","type":"CustomJS"},{"at
